import React from "react";

function fav() {
  return (
    <Naat
      key={Ndata[4].key}
      pic={Ndata[4].pic}
      cat={Ndata[4].cat}
      tit={Ndata[4].tit}
      link={Ndata[4].link}
      dlink={Ndata[4].dlink}
    />
  );
}

export default fav;
